<?php

/**
*<div id="function.mqseries-back" class="refentry">  <div class="refnamediv">   <h1 class="refname">mqseries_back</h1>   <p class="verinfo">(PECL mqseries &gt;= 0.10.0)</p><p class="refpurpose"><span class="refname">mqseries_back</span> &mdash; <span class="dc-title">MQSeries MQBACK</span></p>   </div>   <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-function.mqseries-back-description">   <h3 class="title">说明</h3>   <div class="methodsynopsis dc-description" style="border:1px gray;padding-left:5px;background:#232525">    <span class="type" style="color:#EAB766"><span class="type void" style="color:#EAB766">void</span></span> <span class="methodname" style="color:#CC7832"><strong>mqseries_back</strong></span>     ( <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">$hconn</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$compCode</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$reason</span></span>    )</div>    <p class="para rdfs-comment">    The    <span class="function"><strong style="color:#CC7832">mqseries_back()</strong></span>    (MQBACK) call indicates to the queue manager that all the message gets and    puts that have occurred since the last syncpoint are to be backed out.    Messages put as part of a unit of work are deleted; messages retrieved as    part of a unit of work are reinstated on the queue.   </p>   <p class="para">    Using    <span class="function"><strong style="color:#CC7832">mqseries_back()</strong></span>    only works in conjunction with    <span class="function">{@link mqseries_begin()}</span>    and only function when connecting directly to a Queueu manager. Not via the    mqclient interface.   </p>  </div>     <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-function.mqseries-back-parameters">   <h3 class="title">参数</h3>   <span>    <dl>            <dt>        <span class="parameter" style="color:#2EACF9">hConn</span>      </dt>       <dd>        <p class="para">Connection handle.</p>       <p class="para">This handle represents the connection to the queue manager.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">compCode</span>      </dt>       <dd>        <p class="para">Completion code.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">reason</span>      </dt>       <dd>        <p class="para">Reason code qualifying the compCode.</p>      </dd>          </dl>    </span>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-function.mqseries-back-returnvalues">   <h3 class="title">返回值</h3>   <p class="para">没有返回值。</p>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-function.mqseries-back-examples">   <h3 class="title">范例</h3>   <span>    <div class="example" id="example-5461">     <p><strong>Example #1       <span class="function"><strong style="color:#CC7832">mqseries_back()</strong></span>      example     </strong></p>     <div class="example-contents"> <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"> <span style="color: #9876AA">&lt;?php<br />&nbsp;&nbsp;&nbsp;&nbsp;mqseries_back</span><span style="color: #007700">(</span><span style="color: #9876AA">$conn</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$comp_code</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$reason</span><span style="color: #007700">);<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;if&nbsp;(</span><span style="color: #9876AA">$comp_code&nbsp;</span><span style="color: #007700">!==&nbsp;</span><span style="color: #9876AA">MQSERIES_MQCC_OK</span><span style="color: #007700">)&nbsp;{<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">printf</span><span style="color: #007700">(</span><span style="color: #DD0000">"CompCode:%d&nbsp;Reason:%d&nbsp;Text:%s&lt;br&gt;\n"</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$comp_code</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$reason</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">mqseries_strerror</span><span style="color: #007700">(</span><span style="color: #9876AA">$reason</span><span style="color: #007700">));<br />&nbsp;&nbsp;&nbsp;&nbsp;}<br /></span><span style="color: #9876AA">?&gt;</span> </span> </span></div>     </div>     </div>   </span>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 notes" id="refsect1-function.mqseries-back-notes">   <h3 class="title">注释</h3>   <blockquote class="note" style="border:1px gray solid"><p><strong class="note" style="border:1px gray solid">Note</strong>:     <p class="para">     <span class="function"><strong style="color:#CC7832">mqseries_back()</strong></span>     will not function when using MQSeries Client to connect to a Queueu Manager.    </p>   </p></blockquote>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-function.mqseries-back-seealso">   <h3 class="title">参见</h3>   <span>    <ul class="simplelist">     <li class="member"><span class="function">{@link mqseries_conn()} - MQSeries MQCONN</span></li>     <li class="member"><span class="function">{@link mqseries_connx()} - MQSeries MQCONNX</span></li>     <li class="member"><span class="function">{@link mqseries_begin()} - MQseries MQBEGIN</span></li>    </ul>   </span>  </div>  <div class="up"><a href="http://php.net/manual/zh/ref.mqseries.php">mqseries 函数</a></div></div>
*/
function mqseries_back($hconn, &$compCode, &$reason)
{
}

/**
*<div id="function.mqseries-begin" class="refentry">  <div class="refnamediv">   <h1 class="refname">mqseries_begin</h1>   <p class="verinfo">(PECL mqseries &gt;= 0.10.0)</p><p class="refpurpose"><span class="refname">mqseries_begin</span> &mdash; <span class="dc-title">MQseries MQBEGIN</span></p>   </div>   <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-function.mqseries-begin-description">   <h3 class="title">说明</h3>   <div class="methodsynopsis dc-description" style="border:1px gray;padding-left:5px;background:#232525">    <span class="type" style="color:#EAB766"><span class="type void" style="color:#EAB766">void</span></span> <span class="methodname" style="color:#CC7832"><strong>mqseries_begin</strong></span>     ( <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">$hconn</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">array</span> <span class="parameter" style="color:#2EACF9">$beginOptions</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$compCode</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$reason</span></span>    )</div>    <p class="para rdfs-comment">    The    <span class="function"><strong style="color:#CC7832">mqseries_begin()</strong></span>    (MQBEGIN) call begins a unit of work that is coordinated by the queue    manager, and that may involve external resource managers.   </p>   <p class="para">    Using    <span class="function"><strong style="color:#CC7832">mqseries_begin()</strong></span>    starts the unit of work. Either    <span class="function">{@link mqseries_back()}</span>    or    <span class="function">{@link mqseries_cmit()}</span>    ends the unit of work.   </p>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-function.mqseries-begin-parameters">   <h3 class="title">参数</h3>   <span>    <dl>            <dt>        <span class="parameter" style="color:#2EACF9">hConn</span>      </dt>       <dd>        <p class="para">Connection handle.</p>       <p class="para">This handle represents the connection to the queue manager.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">compCode</span>      </dt>       <dd>        <p class="para">Completion code.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">reason</span>      </dt>       <dd>        <p class="para">Reason code qualifying the compCode.</p>      </dd>          </dl>    </span>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-function.mqseries-begin-returnvalues">   <h3 class="title">返回值</h3>   <p class="para">没有返回值。</p>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-function.mqseries-begin-examples">   <h3 class="title">范例</h3>   <span>    <div class="example" id="example-5462">     <p><strong>Example #1       <span class="function"><strong style="color:#CC7832">mqseries_begin()</strong></span>      example     </strong></p>     <div class="example-contents"> <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"> <span style="color: #9876AA">&lt;?php<br />&nbsp;&nbsp;&nbsp;&nbsp;$mqbo&nbsp;</span><span style="color: #007700">=&nbsp;array();<br />&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">mqseries_begin</span><span style="color: #007700">(&nbsp;</span><span style="color: #9876AA">$conn</span><span style="color: #007700">,&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">$mqbo</span><span style="color: #007700">,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">$comp_code</span><span style="color: #007700">,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">$reason</span><span style="color: #007700">);<br />&nbsp;&nbsp;&nbsp;&nbsp;if&nbsp;(</span><span style="color: #9876AA">$comp_code&nbsp;</span><span style="color: #007700">!==&nbsp;</span><span style="color: #9876AA">MQSERIES_MQCC_OK</span><span style="color: #007700">)&nbsp;{<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #FF8000">//&nbsp;reason&nbsp;code&nbsp;2121&nbsp;is&nbsp;a&nbsp;warning&nbsp;for&nbsp;more&nbsp;information&nbsp;see&nbsp;MQSeries&nbsp;reference&nbsp;manual.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #007700">if&nbsp;(</span><span style="color: #9876AA">$reason&nbsp;</span><span style="color: #007700">!==&nbsp;</span><span style="color: #9876AA">2121</span><span style="color: #007700">)&nbsp;{<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">printf</span><span style="color: #007700">(</span><span style="color: #DD0000">"CompCode:%d&nbsp;Reason:%d&nbsp;Text:%s&lt;br&gt;\n"</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$comp_code</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$reason</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">mqseries_strerror</span><span style="color: #007700">(</span><span style="color: #9876AA">$reason</span><span style="color: #007700">));<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}<br />&nbsp;&nbsp;&nbsp;&nbsp;}<br /></span><span style="color: #9876AA">?&gt;</span> </span> </span></div>     </div>     </div>   </span>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 notes" id="refsect1-function.mqseries-begin-notes">   <h3 class="title">注释</h3>   <blockquote class="note" style="border:1px gray solid"><p><strong class="note" style="border:1px gray solid">Note</strong>:     <p class="para">     <span class="function"><strong style="color:#CC7832">mqseries_begin()</strong></span>     will not function when using MQSeries Client to connect to a Queueu Manager.    </p>   </p></blockquote>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-function.mqseries-begin-seealso">   <h3 class="title">参见</h3>   <span>    <ul class="simplelist">     <li class="member"><span class="function">{@link mqseries_conn()} - MQSeries MQCONN</span></li>     <li class="member"><span class="function">{@link mqseries_connx()} - MQSeries MQCONNX</span></li>     <li class="member"><span class="function">{@link mqseries_back()} - MQSeries MQBACK</span></li>     <li class="member"><span class="function">{@link mqseries_cmit()} - MQSeries MQCMIT</span></li>    </ul>   </span>  </div>  <div class="up"><a href="http://php.net/manual/zh/ref.mqseries.php">mqseries 函数</a></div></div>
*/
function mqseries_begin($hconn, array $beginOptions, &$compCode, &$reason)
{
}

/**
*<div id="function.mqseries-close" class="refentry">  <div class="refnamediv">   <h1 class="refname">mqseries_close</h1>   <p class="verinfo">(PECL mqseries &gt;= 0.10.0)</p><p class="refpurpose"><span class="refname">mqseries_close</span> &mdash; <span class="dc-title">MQSeries MQCLOSE</span></p>   </div>   <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-function.mqseries-close-description">   <h3 class="title">说明</h3>   <div class="methodsynopsis dc-description" style="border:1px gray;padding-left:5px;background:#232525">    <span class="type" style="color:#EAB766"><span class="type void" style="color:#EAB766">void</span></span> <span class="methodname" style="color:#CC7832"><strong>mqseries_close</strong></span>     ( <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">$hconn</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">$hobj</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#2EACF9">$options</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$compCode</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$reason</span></span>    )</div>    <p class="para rdfs-comment">    The    <span class="function"><strong style="color:#CC7832">mqseries_close()</strong></span>    (MQCLOSE) call relinquishes access to an object, and is the inverse of the    <span class="function">{@link mqseries_open()}</span>    (MQOPEN) call.   </p>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-function.mqseries-close-parameters">   <h3 class="title">参数</h3>   <span>    <dl>            <dt>        <span class="parameter" style="color:#2EACF9">hConn</span>      </dt>       <dd>        <p class="para">Connection handle.</p>       <p class="para">This handle represents the connection to the queue manager.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">hObj</span>      </dt>       <dd>        <p class="para">Object handle.</p>       <p class="para">This handle represents the object to be used.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">options</span>      </dt>       <dd>        <p class="para"/>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">compCode</span>      </dt>       <dd>        <p class="para">Completion code.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">reason</span>      </dt>       <dd>        <p class="para">Reason code qualifying the compCode.</p>      </dd>          </dl>    </span>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-function.mqseries-close-returnvalues">   <h3 class="title">返回值</h3>   <p class="para">没有返回值。</p>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-function.mqseries-close-examples">   <h3 class="title">范例</h3>   <span>    <div class="example" id="example-5463">     <p><strong>Example #1       <span class="function"><strong style="color:#CC7832">mqseries_close()</strong></span>      example     </strong></p>     <div class="example-contents"> <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"> <span style="color: #9876AA">&lt;?php<br />&nbsp;&nbsp;&nbsp;&nbsp;mqseries_close</span><span style="color: #007700">(</span><span style="color: #9876AA">$conn</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$obj</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">MQSERIES_MQCO_NONE</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$comp_code</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$reason</span><span style="color: #007700">);<br />&nbsp;&nbsp;&nbsp;&nbsp;if&nbsp;(</span><span style="color: #9876AA">$comp_code&nbsp;</span><span style="color: #007700">!==&nbsp;</span><span style="color: #9876AA">MQSERIES_MQCC_OK</span><span style="color: #007700">)&nbsp;{<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">printf</span><span style="color: #007700">(</span><span style="color: #DD0000">"close&nbsp;CompCode:%d&nbsp;Reason:%d&nbsp;Text:%s&lt;br&gt;\n"</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$comp_code</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$reason</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">mqseries_strerror</span><span style="color: #007700">(</span><span style="color: #9876AA">$reason</span><span style="color: #007700">));<br />&nbsp;&nbsp;&nbsp;&nbsp;}<br /></span><span style="color: #9876AA">?&gt;</span> </span> </span></div>     </div>     </div>   </span>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-function.mqseries-close-seealso">   <h3 class="title">参见</h3>   <span>    <ul class="simplelist">     <li class="member"><span class="function">{@link mqseries_open()} - MQSeries MQOPEN</span></li>     <li class="member"><span class="function">{@link mqseries_conn()} - MQSeries MQCONN</span></li>     <li class="member"><span class="function">{@link mqseries_connx()} - MQSeries MQCONNX</span></li>    </ul>   </span>  </div>  <div class="up"><a href="http://php.net/manual/zh/ref.mqseries.php">mqseries 函数</a></div></div>
*/
