/**
*<div id="function.mqseries-cmit" class="refentry">  <div class="refnamediv">   <h1 class="refname">mqseries_cmit</h1>   <p class="verinfo">(PECL mqseries &gt;= 0.10.0)</p><p class="refpurpose"><span class="refname">mqseries_cmit</span> &mdash; <span class="dc-title">MQSeries MQCMIT</span></p>   </div>   <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-function.mqseries-cmit-description">   <h3 class="title">说明</h3>   <div class="methodsynopsis dc-description" style="border:1px gray;padding-left:5px;background:#232525">    <span class="type" style="color:#EAB766"><span class="type void" style="color:#EAB766">void</span></span> <span class="methodname" style="color:#CC7832"><strong>mqseries_cmit</strong></span>     ( <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">$hconn</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$compCode</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$reason</span></span>    )</div>    <p class="para rdfs-comment">    The    <span class="function"><strong style="color:#CC7832">mqseries_cmit()</strong></span>    (MQCMIT) call indicates to the queue manager that the application has reached    a syncpoint, and that all of the message gets and puts that have occurred    since the last syncpoint are to be made permanent. Messages put as part of a    unit of work are made available to other applications; messages retrieved as    part of a unit of work are deleted.   </p>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-function.mqseries-cmit-parameters">   <h3 class="title">参数</h3>   <span>    <dl>            <dt>        <span class="parameter" style="color:#2EACF9">hConn</span>      </dt>       <dd>        <p class="para">Connection handle.</p>       <p class="para">This handle represents the connection to the queue manager.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">compCode</span>      </dt>       <dd>        <p class="para">Completion code.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">reason</span>      </dt>       <dd>        <p class="para">Reason code qualifying the compCode.</p>      </dd>          </dl>    </span>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-function.mqseries-cmit-returnvalues">   <h3 class="title">返回值</h3>   <p class="para">没有返回值。</p>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-function.mqseries-cmit-examples">   <h3 class="title">范例</h3>   <span>    <div class="example" id="example-5464">     <p><strong>Example #1       <span class="function"><strong style="color:#CC7832">mqseries_cmit()</strong></span>      example     </strong></p>     <div class="example-contents"> <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"> <span style="color: #9876AA">&lt;?php<br />&nbsp;&nbsp;&nbsp;&nbsp;mqseries_cmit</span><span style="color: #007700">(</span><span style="color: #9876AA">$conn</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$comp_code</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$reason</span><span style="color: #007700">);<br />&nbsp;&nbsp;&nbsp;&nbsp;if&nbsp;(</span><span style="color: #9876AA">$comp_code&nbsp;</span><span style="color: #007700">!==&nbsp;</span><span style="color: #9876AA">MQSERIES_MQCC_OK</span><span style="color: #007700">)&nbsp;{<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">printf</span><span style="color: #007700">(</span><span style="color: #DD0000">"cmit&nbsp;CompCode:%d&nbsp;Reason:%d&nbsp;Text:%s&lt;br&gt;\n"</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$comp_code</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$reason</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">mqseries_strerror</span><span style="color: #007700">(</span><span style="color: #9876AA">$reason</span><span style="color: #007700">));<br />&nbsp;&nbsp;&nbsp;&nbsp;}<br /></span><span style="color: #9876AA">?&gt;</span> </span> </span></div>     </div>     </div>   </span>  </div>     <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 notes" id="refsect1-function.mqseries-cmit-notes">   <h3 class="title">注释</h3>   <blockquote class="note" style="border:1px gray solid"><p><strong class="note" style="border:1px gray solid">Note</strong>:     <p class="para">     <span class="function">{@link mqseries_back()}</span>     will not function when using MQSeries Client to connect to a Queueu Manager.    </p>   </p></blockquote>  </div>     <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-function.mqseries-cmit-seealso">   <h3 class="title">参见</h3>   <span>    <ul class="simplelist">     <li class="member"><span class="function">{@link mqseries_begin()} - MQseries MQBEGIN</span></li>     <li class="member"><span class="function">{@link mqseries_back()} - MQSeries MQBACK</span></li>     <li class="member"><span class="function">{@link mqseries_conn()} - MQSeries MQCONN</span></li>     <li class="member"><span class="function">{@link mqseries_connx()} - MQSeries MQCONNX</span></li>    </ul>   </span>  </div>  <div class="up"><a href="http://php.net/manual/zh/ref.mqseries.php">mqseries 函数</a></div></div>
*/
function mqseries_cmit($hconn, &$compCode, &$reason)
{
}

/**
*<div id="function.mqseries-conn" class="refentry">  <div class="refnamediv">   <h1 class="refname">mqseries_conn</h1>   <p class="verinfo">(PECL mqseries &gt;= 0.10.0)</p><p class="refpurpose"><span class="refname">mqseries_conn</span> &mdash; <span class="dc-title">MQSeries MQCONN</span></p>   </div>   <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-function.mqseries-conn-description">   <h3 class="title">说明</h3>   <div class="methodsynopsis dc-description" style="border:1px gray;padding-left:5px;background:#232525">    <span class="type" style="color:#EAB766"><span class="type void" style="color:#EAB766">void</span></span> <span class="methodname" style="color:#CC7832"><strong>mqseries_conn</strong></span>     ( <span class="methodparam"><span class="type" style="color:#EAB766">string</span> <span class="parameter" style="color:#2EACF9">$qManagerName</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$hconn</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$compCode</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$reason</span></span>    )</div>    <p class="para rdfs-comment">    The    <span class="function"><strong style="color:#CC7832">mqseries_conn()</strong></span>    (MQCONN) call connects an application program to a queue manager. It provides    a queue manager connection handle, which is used by the application on    subsequent message queuing calls.   </p>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-function.mqseries-conn-parameters">   <h3 class="title">参数</h3>   <span>    <dl>            <dt>        <span class="parameter" style="color:#2EACF9">qManagerName</span>      </dt>       <dd>        <p class="para">Name of queue manager.</p>       <p class="para">Name of the queue manager the application wishes to connect.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">hConn</span>      </dt>       <dd>        <p class="para">Connection handle.</p>       <p class="para">This handle represents the connection to the queue manager.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">compCode</span>      </dt>       <dd>        <p class="para">Completion code.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">reason</span>      </dt>       <dd>        <p class="para">Reason code qualifying the compCode.</p>      </dd>          </dl>    </span>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-function.mqseries-conn-returnvalues">   <h3 class="title">返回值</h3>   <p class="para">没有返回值。</p>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-function.mqseries-conn-examples">   <h3 class="title">范例</h3>   <span>    <div class="example" id="example-5465">     <p><strong>Example #1       <span class="function"><strong style="color:#CC7832">mqseries_conn()</strong></span>      example     </strong></p>     <div class="example-contents"> <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"> <span style="color: #9876AA">&lt;?php<br />&nbsp;&nbsp;&nbsp;&nbsp;mqseries_conn</span><span style="color: #007700">(</span><span style="color: #DD0000">'WMQ1'</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$conn</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$comp_code</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$reason</span><span style="color: #007700">);<br />&nbsp;&nbsp;&nbsp;&nbsp;if&nbsp;(</span><span style="color: #9876AA">$comp_code&nbsp;</span><span style="color: #007700">!==&nbsp;</span><span style="color: #9876AA">MQSERIES_MQCC_OK</span><span style="color: #007700">)&nbsp;{<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">printf</span><span style="color: #007700">(</span><span style="color: #DD0000">"conn&nbsp;CompCode:%d&nbsp;Reason:%d&nbsp;Text:%s&lt;br&gt;\n"</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$comp_code</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$reason</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">mqseries_strerror</span><span style="color: #007700">(</span><span style="color: #9876AA">$reason</span><span style="color: #007700">));<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;exit;<br />&nbsp;&nbsp;&nbsp;&nbsp;}<br /></span><span style="color: #9876AA">?&gt;</span> </span> </span></div>     </div>     </div>   </span>  </div>     <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-function.mqseries-conn-seealso">   <h3 class="title">参见</h3>   <span>    <ul class="simplelist">     <li class="member"><span class="function">{@link mqseries_disc()} - MQSeries MQDISC</span></li>    </ul>   </span>  </div>  <div class="up"><a href="http://php.net/manual/zh/ref.mqseries.php">mqseries 函数</a></div></div>
*/
function mqseries_conn($qManagerName, &$hconn, &$compCode, &$reason)
{
}

/**
*<div id="function.mqseries-connx" class="refentry">  <div class="refnamediv">   <h1 class="refname">mqseries_connx</h1>   <p class="verinfo">(PECL mqseries &gt;= 0.10.0)</p><p class="refpurpose"><span class="refname">mqseries_connx</span> &mdash; <span class="dc-title">MQSeries MQCONNX</span></p>   </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-function.mqseries-connx-description">   <h3 class="title">说明</h3>   <div class="methodsynopsis dc-description" style="border:1px gray;padding-left:5px;background:#232525">    <span class="type" style="color:#EAB766"><span class="type void" style="color:#EAB766">void</span></span> <span class="methodname" style="color:#CC7832"><strong>mqseries_connx</strong></span>     ( <span class="methodparam"><span class="type" style="color:#EAB766">string</span> <span class="parameter" style="color:#2EACF9">$qManagerName</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">array</span> <span class="parameter" style="color:#2EACF9">&$connOptions</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$hconn</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$compCode</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$reason</span></span>    )</div>    <p class="para rdfs-comment">    The    <span class="function"><strong style="color:#CC7832">mqseries_connx()</strong></span>    (MQCONNX) call connects an application program to a queue manager. It    provides a queue manager connection handle, which is used by the application    on subsequent MQ calls.   </p>   <p class="para">    The <span class="function"><strong style="color:#CC7832">mqseries_connx()</strong></span> call is like the     <span class="function">{@link mqseries_conn()}</span> (MQCONN) call, except that MQCONNX     allows options to be specified to control the way that the call works.   </p>  </div>     <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-function.mqseries-connx-parameters">   <h3 class="title">参数</h3>   <span>    <dl>            <dt>        <span class="parameter" style="color:#2EACF9">qManagerName</span>      </dt>       <dd>        <p class="para">Name of queue manager.</p>       <p class="para">Name of the queue manager the application wishes to connect.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">connOps</span>      </dt>       <dd>        <p class="para">Options that control the action of function</p>       <p class="para">See also the MQCNO structure.</p>      </dd>                      <dt>        <span class="parameter" style="color:#2EACF9">hConn</span>      </dt>       <dd>        <p class="para">Connection handle.</p>       <p class="para">This handle represents the connection to the queue manager.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">compCode</span>      </dt>       <dd>        <p class="para">Completion code.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">reason</span>      </dt>       <dd>        <p class="para">Reason code qualifying the compCode.</p>      </dd>          </dl>    </span>  </div>     <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-function.mqseries-connx-returnvalues">   <h3 class="title">返回值</h3>   <p class="para">没有返回值。</p>  </div>     <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-function.mqseries-connx-examples">   <h3 class="title">范例</h3>   <span>    <div class="example" id="example-5466">     <p><strong>Example #1       <span class="function"><strong style="color:#CC7832">mqseries_connx()</strong></span>      example     </strong></p>     <div class="example-contents"> <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"> <span style="color: #9876AA">&lt;?php<br />&nbsp;&nbsp;&nbsp;&nbsp;$mqcno&nbsp;</span><span style="color: #007700">=&nbsp;array(<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'Version'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #9876AA">MQSERIES_MQCNO_VERSION_2</span><span style="color: #007700">,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'Options'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #9876AA">MQSERIES_MQCNO_STANDARD_BINDING</span><span style="color: #007700">,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'MQCD'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;array(</span><span style="color: #DD0000">'ChannelName'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #DD0000">'MQNX9420.CLIENT'</span><span style="color: #007700">,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'ConnectionName'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #DD0000">'localhost'</span><span style="color: #007700">,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'TransportType'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #9876AA">MQSERIES_MQXPT_TCP</span><span style="color: #007700">)<br />&nbsp;&nbsp;&nbsp;&nbsp;);<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">mqseries_connx</span><span style="color: #007700">(</span><span style="color: #DD0000">'MQNX9420'</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$mqcno</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$conn</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$comp_code</span><span style="color: #007700">,</span><span style="color: #9876AA">$reason</span><span style="color: #007700">);<br />&nbsp;&nbsp;&nbsp;&nbsp;if&nbsp;(</span><span style="color: #9876AA">$comp_code&nbsp;</span><span style="color: #007700">!==&nbsp;</span><span style="color: #9876AA">MQSERIES_MQCC_OK</span><span style="color: #007700">)&nbsp;{<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">printf</span><span style="color: #007700">(</span><span style="color: #DD0000">"Connx&nbsp;CompCode:%d&nbsp;Reason:%d&nbsp;Text:%s&lt;br&gt;\n"</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$comp_code</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$reason</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">mqseries_strerror</span><span style="color: #007700">(</span><span style="color: #9876AA">$reason</span><span style="color: #007700">));<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;exit;<br />&nbsp;&nbsp;&nbsp;&nbsp;}<br />&nbsp;<br /></span><span style="color: #9876AA">?&gt;</span> </span> </span></div>     </div>     </div>    <div class="example" id="example-5467">     <p><strong>Example #2       <span class="function"><strong style="color:#CC7832">mqseries_connx()</strong></span>      example using SSL connection &amp; OCSP Responder URL     </strong></p>     <div class="example-contents"> <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"> <span style="color: #9876AA">&lt;?php<br />&nbsp;&nbsp;&nbsp;&nbsp;$mqcno&nbsp;</span><span style="color: #007700">=&nbsp;array(<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'Version'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #9876AA">4</span><span style="color: #007700">,&nbsp;</span><span style="color: #FF8000">//MQCNO_VERSION_4<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'Options'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #9876AA">MQSERIES_MQCNO_STANDARD_BINDING</span><span style="color: #007700">,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'MQCD'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;array(<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'Version'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #9876AA">7</span><span style="color: #007700">,&nbsp;</span><span style="color: #FF8000">//MQCD_VERSION_7<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'ConnectionName'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #DD0000">'localhost'</span><span style="color: #007700">,&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'TransportType'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #9876AA">MQSERIES_MQXPT_TCP</span><span style="color: #007700">,&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'ChannelName'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #DD0000">'CONNECTIONCHANNEL'</span><span style="color: #007700">,&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'SSLCipherSpec'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #DD0000">'NULL_SHA'<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #007700">),&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'MQSCO'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;array(<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'KeyRepository'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #DD0000">'/var/mqm/qmgrs/QUEUEMGR/ssl/key'</span><span style="color: #007700">,&nbsp;</span><span style="color: #FF8000">//Local&nbsp;path&nbsp;where&nbsp;the&nbsp;SSL&nbsp;key&nbsp;repository&nbsp;can&nbsp;be&nbsp;found<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'MQAIR'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;array(<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'Version'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #9876AA">2</span><span style="color: #007700">,&nbsp;</span><span style="color: #FF8000">//MQAIR_VERSION_2<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'AuthInfoType'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #9876AA">2</span><span style="color: #007700">,&nbsp;</span><span style="color: #FF8000">//MQAIT_OCSP&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'OCSPResponderURL'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #DD0000">'http://dummy.OCSP.responder'<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #007700">)<br />&nbsp;&