/**
*<div id="function.mqseries-get" class="refentry">  <div class="refnamediv">   <h1 class="refname">mqseries_get</h1>   <p class="verinfo">(PECL mqseries &gt;= 0.10.0)</p><p class="refpurpose"><span class="refname">mqseries_get</span> &mdash; <span class="dc-title">MQSeries MQGET</span></p>   </div>   <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-function.mqseries-get-description">   <h3 class="title">说明</h3>   <div class="methodsynopsis dc-description" style="border:1px gray;padding-left:5px;background:#232525">    <span class="type" style="color:#EAB766"><span class="type void" style="color:#EAB766">void</span></span> <span class="methodname" style="color:#CC7832"><strong>mqseries_get</strong></span>     ( <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">$hConn</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">$hObj</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">array</span> <span class="parameter" style="color:#2EACF9">&$md</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">array</span> <span class="parameter" style="color:#2EACF9">&$gmo</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#2EACF9">&$bufferLength</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">string</span> <span class="parameter" style="color:#2EACF9">&$msg</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#2EACF9">&$data_length</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$compCode</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$reason</span></span>    )</div>    <p class="para rdfs-comment">    The    <span class="function"><strong style="color:#CC7832">mqseries_get()</strong></span>    (MQGET) call retrieves a message from a local queue that has been opened    using the    <span class="function">{@link mqseries_open()}</span>    (MQOPEN) call   </p>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-function.mqseries-get-parameters">   <h3 class="title">参数</h3>   <span>    <dl>            <dt>        <span class="parameter" style="color:#2EACF9">hConn</span>      </dt>       <dd>        <p class="para">Connection handle.</p>       <p class="para">This handle represents the connection to the queue manager.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">hObj</span>      </dt>       <dd>        <p class="para">Object handle.</p>       <p class="para">This handle represents the object to be used.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">md</span>      </dt>       <dd>        <p class="para">Message descriptor (MQMD).</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">gmo</span>      </dt>       <dd>        <p class="para">Get message options (MQGMO).</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">bufferLength</span>      </dt>       <dd>        <p class="para">Expected length of the result buffer</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">msg</span>      </dt>       <dd>        <p class="para">        Buffer holding the message that was retrieved from the object.       </p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">data_length</span>      </dt>       <dd>        <p class="para">Actual buffer length</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">compCode</span>      </dt>       <dd>        <p class="para">Completion code.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">reason</span>      </dt>       <dd>        <p class="para">Reason code qualifying the compCode.</p>      </dd>          </dl>    </span>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-function.mqseries-get-returnvalues">   <h3 class="title">返回值</h3>   <p class="para">没有返回值。</p>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-function.mqseries-get-examples">   <h3 class="title">范例</h3>   <span>    <div class="example" id="example-5469">     <p><strong>Example #1       <span class="function"><strong style="color:#CC7832">mqseries_get()</strong></span>      example     </strong></p>     <div class="example-contents"> <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"> <span style="color: #9876AA">&lt;?php<br /></span><span style="color: #FF8000">//&nbsp;open&nbsp;connection&nbsp;to&nbsp;the&nbsp;queue&nbsp;manager<br />&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">mqseries_conn</span><span style="color: #007700">(</span><span style="color: #DD0000">'WMQ1'</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$conn</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$comp_code</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$reason</span><span style="color: #007700">);<br /></span><span style="color: #FF8000">//&nbsp;$conn&nbsp;now&nbsp;hold&nbsp;the&nbsp;reference&nbsp;to&nbsp;the&nbsp;connection&nbsp;to&nbsp;the&nbsp;queue&nbsp;manager.<br /><br />//&nbsp;open&nbsp;the&nbsp;connection&nbsp;to&nbsp;the&nbsp;testq&nbsp;queue<br />&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">mqseries_open</span><span style="color: #007700">(<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">$conn</span><span style="color: #007700">,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;array(</span><span style="color: #DD0000">'ObjectName'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #DD0000">'TESTQ'</span><span style="color: #007700">),<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">MQSERIES_MQOO_INPUT_AS_Q_DEF&nbsp;</span><span style="color: #007700">|&nbsp;</span><span style="color: #9876AA">MQSERIES_MQOO_FAIL_IF_QUIESCING&nbsp;</span><span style="color: #007700">|&nbsp;</span><span style="color: #9876AA">MQSERIES_MQOO_OUTPUT</span><span style="color: #007700">,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">$obj</span><span style="color: #007700">,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">$comp_code</span><span style="color: #007700">,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">$reason</span><span style="color: #007700">);<br /></span><span style="color: #FF8000">//&nbsp;$obj&nbsp;now&nbsp;holds&nbsp;the&nbsp;reference&nbsp;to&nbsp;the&nbsp;object&nbsp;(TESTQ)<br /><br />//&nbsp;setup&nbsp;empty&nbsp;message&nbsp;descriptor.<br />&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">$mdg&nbsp;</span><span style="color: #007700">=&nbsp;array();<br /></span><span style="color: #FF8000">//&nbsp;setup&nbsp;get&nbsp;message&nbsp;options&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">$gmo&nbsp;</span><span style="color: #007700">=&nbsp;array(</span><span style="color: #DD0000">'Options'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #9876AA">MQSERIES_MQGMO_FAIL_IF_QUIESCING&nbsp;</span><span style="color: #007700">|&nbsp;</span><span style="color: #9876AA">MQSERIES_MQGMO_WAIT</span><span style="color: #007700">,&nbsp;</span><span style="color: #DD0000">'WaitInterval'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #9876AA">3000</span><span style="color: #007700">);<br /><br /></span><span style="color: #FF8000">//&nbsp;get&nbsp;the&nbsp;message&nbsp;from&nbsp;the&nbsp;queue&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">mqseries_get</span><span style="color: #007700">(</span><span style="color: #9876AA">$conn</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$obj</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$mdg</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$gmo</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">255</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$msg</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$data_length</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$comp_code</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$reason</span><span style="color: #007700">);<br />&nbsp;&nbsp;&nbsp;&nbsp;if&nbsp;(</span><span style="color: #9876AA">$comp_code&nbsp;</span><span style="color: #007700">!==&nbsp;</span><span style="color: #9876AA">MQSERIES_MQCC_OK</span><span style="