/**
*<div id="function.mqseries-put1" class="refentry">  <div class="refnamediv">   <h1 class="refname">mqseries_put1</h1>   <p class="verinfo">(PECL mqseries &gt;= 0.10.0)</p><p class="refpurpose"><span class="refname">mqseries_put1</span> &mdash; <span class="dc-title">MQSeries MQPUT1</span></p>   </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-function.mqseries-put1-description">   <h3 class="title">说明</h3>   <div class="methodsynopsis dc-description" style="border:1px gray;padding-left:5px;background:#232525">    <span class="type" style="color:#EAB766"><span class="type void" style="color:#EAB766">void</span></span> <span class="methodname" style="color:#CC7832"><strong>mqseries_put1</strong></span>     ( <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">$hconn</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$objDesc</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$msgDesc</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$pmo</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">string</span> <span class="parameter" style="color:#2EACF9">$buffer</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$compCode</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$reason</span></span>    )</div>    <p class="para rdfs-comment">    The    <span class="function"><strong style="color:#CC7832">mqseries_put1()</strong></span>    (MQPUT1) call puts one message on a queue. The queue need not be open.   </p>   <p class="para">    You can use both the <span class="function">{@link mqseries_put()}</span> and <span class="function"><strong style="color:#CC7832">mqseries_put1()</strong></span>    calls to put messages on a queue; which call to use depends on the circumstances.    Use the <span class="function">{@link mqseries_put()}</span> (MQPUT) call to place multiple messages on the same queue.    Use the <span class="function"><strong style="color:#CC7832">mqseries_put1()</strong></span> (MQPUT1) call to put only one message on a queue.    This call encapsulates the MQOPEN, MQPUT, and MQCLOSE calls into a single call, minimizing the    number of calls that must be issued.   </p>  </div>     <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-function.mqseries-put1-parameters">   <h3 class="title">参数</h3>   <span>    <dl>            <dt>        <span class="parameter" style="color:#2EACF9">hConn</span>      </dt>       <dd>        <p class="para">Connection handle.</p>       <p class="para">This handle represents the connection to the queue manager.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">objDesc</span>      </dt>       <dd>        <p class="para">Object descriptor. (MQOD)</p>       <p class="para">        This is a structure which identifies the queue to which the message is        added.       </p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">msgDesc</span>      </dt>       <dd>        <p class="para">Message descriptor (MQMD).</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">pmo</span>      </dt>       <dd>        <p class="para">Put message options (MQPMO).</p>      </dd>                      <dt>        <span class="parameter" style="color:#2EACF9">compCode</span>      </dt>       <dd>        <p class="para">Completion code.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">reason</span>      </dt>       <dd>        <p class="para">Reason code qualifying the compCode.</p>      </dd>          </dl>    </span>  </div>     <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-function.mqseries-put1-returnvalues">   <h3 class="title">返回值</h3>   <p class="para">没有返回值。</p>  </div>     <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-function.mqseries-put1-seealso">   <h3 class="title">参见</h3>   <span>    <ul class="simplelist">     <li class="member"><span class="function">{@link mqseries_conn()} - MQSeries MQCONN</span></li>     <li class="member"><span class="function">{@link mqseries_connx()} - MQSeries MQCONNX</span></li>     <li class="member"><span class="function">{@link mqseries_open()} - MQSeries MQOPEN</span></li>     <li class="member"><span class="function">{@link mqseries_get()} - MQSeries MQGET</span></li>    </ul>   </span>  </div>  <div class="up"><a href="http://php.net/manual/zh/ref.mqseries.php">mqseries 函数</a></div></div>
*/
