/**
*<div id="function.mqseries-put" class="refentry">  <div class="refnamediv">   <h1 class="refname">mqseries_put</h1>   <p class="verinfo">(PECL mqseries &gt;= 0.10.0)</p><p class="refpurpose"><span class="refname">mqseries_put</span> &mdash; <span class="dc-title">MQSeries MQPUT</span></p>   </div>   <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-function.mqseries-put-description">   <h3 class="title">说明</h3>   <div class="methodsynopsis dc-description" style="border:1px gray;padding-left:5px;background:#232525">    <span class="type" style="color:#EAB766"><span class="type void" style="color:#EAB766">void</span></span> <span class="methodname" style="color:#CC7832"><strong>mqseries_put</strong></span>     ( <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">$hConn</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">$hObj</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">array</span> <span class="parameter" style="color:#2EACF9">&$md</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">array</span> <span class="parameter" style="color:#2EACF9">&$pmo</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">string</span> <span class="parameter" style="color:#2EACF9">$message</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$compCode</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$reason</span></span>    )</div>    <p class="para rdfs-comment">    The    <span class="function"><strong style="color:#CC7832">mqseries_put()</strong></span>    (MQPUT) call puts a message on a queue or distribution list. The queue or    distribution list must already be open.   </p>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-function.mqseries-put-parameters">   <h3 class="title">参数</h3>   <span>    <dl>            <dt>        <span class="parameter" style="color:#2EACF9">hConn</span>      </dt>       <dd>        <p class="para">Connection handle.</p>       <p class="para">This handle represents the connection to the queue manager.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">hObj</span>      </dt>       <dd>        <p class="para">Object handle.</p>       <p class="para">This handle represents the object to be used.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">md</span>      </dt>       <dd>        <p class="para">Message descriptor (MQMD).</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">pmo</span>      </dt>       <dd>        <p class="para">Put message options (MQPMO).</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">message</span>      </dt>       <dd>        <p class="para">The actual message to put onto the queue.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">compCode</span>      </dt>       <dd>        <p class="para">Completion code.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">reason</span>      </dt>       <dd>        <p class="para">Reason code qualifying the compCode.</p>      </dd>          </dl>    </span>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-function.mqseries-put-returnvalues">   <h3 class="title">返回值</h3>   <p class="para">没有返回值。</p>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-function.mqseries-put-examples">   <h3 class="title">范例</h3>   <span>    <div class="example" id="example-5472">     <p><strong>Example #1       <span class="function"><strong style="color:#CC7832">mqseries_put()</strong></span>      example     </strong></p>     <div class="example-contents"> <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"> <span style="color: #9876AA">&lt;?php<br /></span><span style="color: #FF8000">//&nbsp;open&nbsp;connection&nbsp;to&nbsp;the&nbsp;queue&nbsp;manager<br />&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">mqseries_conn</span><span style="color: #007700">(</span><span style="color: #DD0000">'WMQ1'</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$conn</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$comp_code</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$reason</span><span style="color: #007700">);<br /></span><span style="color: #FF8000">//&nbsp;$conn&nbsp;now&nbsp;hold&nbsp;the&nbsp;reference&nbsp;to&nbsp;the&nbsp;connection&nbsp;to&nbsp;the&nbsp;queue&nbsp;manager.<br /><br />//&nbsp;open&nbsp;the&nbsp;connectio&nbsp;to&nbsp;the&nbsp;testq&nbsp;queueu<br />&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">mqseries_open</span><span style="color: #007700">(<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">$conn</span><span style="color: #007700">,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;array(</span><span style="color: #DD0000">'ObjectName'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #DD0000">'TESTQ'</span><span style="color: #007700">),<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">MQSERIES_MQOO_INPUT_AS_Q_DEF&nbsp;</span><span style="color: #007700">|&nbsp;</span><span style="color: #9876AA">MQSERIES_MQOO_FAIL_IF_QUIESCING&nbsp;</span><span style="color: #007700">|&nbsp;</span><span style="color: #9876AA">MQSERIES_MQOO_OUTPUT</span><span style="color: #007700">,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">$obj</span><span style="color: #007700">,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">$comp_code</span><span style="color: #007700">,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">$reason</span><span style="color: #007700">);<br /></span><span style="color: #FF8000">//&nbsp;$obj&nbsp;now&nbsp;holds&nbsp;the&nbsp;reference&nbsp;to&nbsp;the&nbsp;object&nbsp;(TESTQ)<br /><br />//&nbsp;setup&nbsp;the&nbsp;message&nbsp;descriptor&nbsp;array.&nbsp;Check&nbsp;MQSeries&nbsp;reference&nbsp;manuals.<br />&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">$md&nbsp;</span><span style="color: #007700">=&nbsp;array(<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'Version'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #9876AA">MQSERIES_MQMD_VERSION_1</span><span style="color: #007700">,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'Expiry'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #9876AA">MQSERIES_MQEI_UNLIMITED</span><span style="color: #007700">,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'Report'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #9876AA">MQSERIES_MQRO_NONE</span><span style="color: #007700">,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'MsgType'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #9876AA">MQSERIES_MQMT_DATAGRAM</span><span style="color: #007700">,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'Format'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #9876AA">MQSERIES_MQFMT_STRING</span><span style="color: #007700">,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'Priority'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #9876AA">1</span><span style="color: #007700">,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #DD0000">'Persistence'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #9876AA">MQSERIES_MQPER_PERSISTENT</span><span style="color: #007700">);<br /><br /></span><span style="color: #FF8000">//&nbsp;setup&nbsp;the&nbsp;put&nbsp;message&nbsp;options.<br />&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">$pmo&nbsp;</span><span style="color: #007700">=&nbsp;array(</span><span style="color: #DD0000">'Options'&nbsp;</span><span style="color: #007700">=&gt;&nbsp;</span><span style="color: #9876AA">MQSERIES_MQPMO_NEW_MSG_ID</span><span style="color: #007700">|</span><span style="color: #9876AA">MQSERIES_MQPMO_SYNCPOINT</span><span style="color: #007700">);<br />&nbsp;&nbsp;&nbsp;&nbsp;<br /></span><span style="color: #FF8000">//&nbsp;put&nbsp;the&nbsp;message&nbsp;'Ping'&nbsp;on&nbsp;the&nbsp;queueu.<br />&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">mqseries_put</span><span style="color: #007700">(</span><span style="color: #9876AA">$conn</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$obj</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$md</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$pmo</span><span style="color: #007700">,&nbsp;</span><span style="color: #DD0000">'Ping'</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$comp_code</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$reason</span><span style="color: #007700">);<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;if&nbsp;(</span><span style="color: #9876AA">$comp_code&nbsp;</span><span style="color: #007700">!==&nbsp;</span><span style="color: #9876AA">MQSERIES_MQCC_OK</span><span style="color: #007700">)&nbsp;{<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">printf</span><span style="color: #007700">(</span><span style="color: #DD0000">"put&nbsp;CompCode:%d&nbsp;Reason:%d&nbsp;Text:%s&lt;br&gt;\n"</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$comp_code</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$reason</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">mqseries_strerror</span><span style="color: #007700">(</span><span style="color: #9876AA">$reason</span><span style="color: #007700">));<br />&nbsp;&nbsp;&nbsp;&nbsp;}<br /><br /></span><span style="color: #FF8000">//&nbsp;close&nbsp;the&nbsp;object&nbsp;reference&nbsp;$obj&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">mqseries_close</span><span style="color: #007700">(</span><span style="color: #9876AA">$conn</span><span style="color: #007700">,&nbsp