/**
*<div id="function.mqseries-set" class="refentry">  <div class="refnamediv">   <h1 class="refname">mqseries_set</h1>   <p class="verinfo">(PECL mqseries &gt;= 0.10.0)</p><p class="refpurpose"><span class="refname">mqseries_set</span> &mdash; <span class="dc-title">MQSeries MQSET</span></p>   </div>   <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-function.mqseries-set-description">   <h3 class="title">说明</h3>   <div class="methodsynopsis dc-description" style="border:1px gray;padding-left:5px;background:#232525">    <span class="type" style="color:#EAB766"><span class="type void" style="color:#EAB766">void</span></span> <span class="methodname" style="color:#CC7832"><strong>mqseries_set</strong></span>     ( <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">$hConn</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">$hObj</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#2EACF9">$selectorCount</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">array</span> <span class="parameter" style="color:#2EACF9">$selectors</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#2EACF9">$intAttrCount</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">array</span> <span class="parameter" style="color:#2EACF9">$intAttrs</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#2EACF9">$charAttrLength</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">array</span> <span class="parameter" style="color:#2EACF9">$charAttrs</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$compCode</span></span>    , <span class="methodparam"><span class="type" style="color:#EAB766">resource</span> <span class="parameter" style="color:#2EACF9">&$reason</span></span>    )</div>    <p class="para rdfs-comment">    The <span class="function"><strong style="color:#CC7832">mqseries_set()</strong></span>    (MQSET) call is used to change the attributes of an object represented by a    handle. The object must be a queue.   </p>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-function.mqseries-set-parameters">   <h3 class="title">参数</h3>   <span>    <dl>            <dt>        <span class="parameter" style="color:#2EACF9">hConn</span>      </dt>       <dd>        <p class="para">Connection handle.</p>       <p class="para">This handle represents the connection to the queue manager.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">hObj</span>      </dt>       <dd>        <p class="para">Object handle.</p>       <p class="para">This handle represents the object to be used.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">selectorCount</span>      </dt>       <dd>        <p class="para">Count of selectors.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">selectors</span>      </dt>       <dd>        <p class="para">Array of attribute selectors.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">intAttrCount</span>      </dt>       <dd>        <p class="para">Count of integer attributes.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">intAttrs</span>      </dt>       <dd>        <p class="para">Array of integer attributes.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">charAttrLength</span>      </dt>       <dd>        <p class="para">Length of character attributes buffer.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">charAttrs</span>      </dt>       <dd>        <p class="para">Character attributes.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">compCode</span>      </dt>       <dd>        <p class="para">Completion code.</p>      </dd>                 <dt>        <span class="parameter" style="color:#2EACF9">reason</span>      </dt>       <dd>        <p class="para">Reason code qualifying the compCode.</p>      </dd>          </dl>    </span>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-function.mqseries-set-returnvalues">   <h3 class="title">返回值</h3>   <p class="para">没有返回值。</p>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-function.mqseries-set-seealso">   <h3 class="title">参见</h3>   <span>    <ul class="simplelist">     <li class="member"><span class="function">{@link mqseries_inq()} - MQSeries MQINQ</span></li>    </ul>   </span>  </div>  <div class="up"><a href="http://php.net/manual/zh/ref.mqseries.php">mqseries 函数</a></div></div>
