*<div id="function.mqseries-strerror" class="refentry">  <div class="refnamediv">   <h1 class="refname">mqseries_strerror</h1>   <p class="verinfo">(PECL mqseries &gt;= 0.10.0)</p><p class="refpurpose"><span class="refname">mqseries_strerror</span> &mdash; <span class="dc-title">Returns the error message corresponding to a result code (MQRC)</span></p>   </div>   <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-function.mqseries-strerror-description">   <h3 class="title">说明</h3>   <div class="methodsynopsis dc-description" style="border:1px gray;padding-left:5px;background:#232525">    <span class="type" style="color:#EAB766">string</span> <span class="methodname" style="color:#CC7832"><strong>mqseries_strerror</strong></span>     ( <span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#2EACF9">$reason</span></span>    )</div>    <p class="para rdfs-comment">    <span class="function"><strong style="color:#CC7832">mqseries_strerror()</strong></span>    returns the message that correspond to the reason result code.   </p>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-function.mqseries-strerror-parameters">   <h3 class="title">参数</h3>   <span>    <dl>            <dt>        <span class="parameter" style="color:#2EACF9">reason</span>      </dt>       <dd>        <p class="para">Reason code qualifying the compCode.</p>      </dd>          </dl>    </span>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-function.mqseries-strerror-returnvalues">   <h3 class="title">返回值</h3>   <p class="para">string representation of the reason code message.</p>  </div>    <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-function.mqseries-strerror-examples">   <h3 class="title">范例</h3>   <span>    <div class="example" id="example-5473">     <p><strong>Example #1       <span class="function"><strong style="color:#CC7832">mqseries_strerror()</strong></span>      example     </strong></p>     <div class="example-contents"> <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"> <span style="color: #9876AA">&lt;?php<br />&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #007700">if&nbsp;(</span><span style="color: #9876AA">$comp_code&nbsp;</span><span style="color: #007700">!==&nbsp;</span><span style="color: #9876AA">MQSERIES_MQCC_OK</span><span style="color: #007700">)&nbsp;{<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="color: #9876AA">printf</span><span style="color: #007700">(</span><span style="color: #DD0000">"open&nbsp;CompCode:%d&nbsp;Reason:%d&nbsp;Text:%s&lt;br&gt;\n"</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$comp_code</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">$reason</span><span style="color: #007700">,&nbsp;</span><span style="color: #9876AA">mqseries_strerror</span><span style="color: #007700">(</span><span style="color: #9876AA">$reason</span><span style="color: #007700">));<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;exit;<br />&nbsp;&nbsp;&nbsp;&nbsp;}<br /></span><span style="color: #9876AA">?&gt;</span> </span> </span></div>     </div>      <div class="example-contents"><p>以上例程会输出：</p></div>     <div class="example-contents screen" style="background:black;padding-left:5px;"> <div class="cdata"><span> Connx CompCode:2 Reason:2059 Text:Queue manager not available for connection.                     </span></div>     </div>    </div>   </span>  </div>  <div class="up"><a href="http://php.net/manual/zh/ref.mqseries.php">mqseries 函数</a></div></div>
 * @return string*/
function mqseries_strerror($reason)
{
    return (string)$reason;
}

